import {
  Nav,
  NavLink,
  Bars,
  NavMenu,
  NavBtn,
  NavBtnLink
} from '../components/NavBar';
import logoWhiteImg from '../assets/images/telzir-white.png'


export function AppPage() {
  return (
    <>
      <Nav>
        <NavLink to='/'>
          <img src={logoWhiteImg} alt='logo' />
        </NavLink>
        <Bars />
        <NavMenu>
          <span>Marcus Schebek</span>
        </NavMenu>
        <NavBtn>
          <NavBtnLink to='/'>Sair</NavBtnLink>
        </NavBtn>
      </Nav>
    </>
  );
};
